import React from "react";
import "./Home.css"
import { useEffect, useState } from "react"

const Home = () => {
  const [users, setUsers] = useState([])

  const fetchData = () => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setUsers(data)
      })
  }

  // console.log(users)

  useEffect(() => {
    fetchData()
  }, [])
  function sortOut() {
    let tempArrayObj = JSON.stringify(users)

    console.log(tempArrayObj)


  }

  return (
    <>
      <div style={{ fontSize: "3rem", textAlign: "center", margin: "1%" }}>Dashboard</div>
      <button onClick={sortOut()}>Sort</button>
      <table>
        <tr >
          <th >Sno</th>
          <th >name</th>
          <th>Email</th>
        </tr>
        {users.map((item, ind) => (
          <tr>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.email}</td>
          </tr>

        ))}
      </table>


    </>
  )

};

export default Home;
